import { React, lazy } from "react";
import './index.css';
// import HomePage from "./HomePage";
// import About from './About';
const NavBar = lazy(() => import('./Components/Navbar'));


function App() {
  const handleClick =()=>{
     const handleClick = () => {
    navigate('/home');
  };
  }
  return (
    <div >
        <NavBar handleClick={handleClick} />
    </div>
  );
}

export default App;
